import {Link} from "react-router-dom"
import { useStoreActions, useStoreState } from '../../../Store/hooks';
const NavBar = () => {
    const {setName} = useStoreActions(store => store)
    const { name } = useStoreState((store) => store)

    const clickHandle = () => {
        setName("")
        localStorage.setItem('userId', "")
    }
    return (
        <div className="navBarContainer">
            
            {name &&
                <div>
                    <span onClick={clickHandle}>Logout</span>
                </div>
            }
            <div className="NavBarLink">
                <Link className="navLink" to="/home">Home</Link>
            </div>
            <div className="NavBarLink">
                <Link className="navLink" to="/gen">Generators</Link>
            </div>
            <div className="NavBarLink">
                <Link className="navLink" to="/cc">Custom Content</Link> 
            </div>
            

        </div>
    )
}
export default NavBar
